import React from "react";
import { RouteComponentProps, useLocation } from "react-router";
import profilePic from "./images/profile/2602017071517530029820170521192154199Screenshot_2016-05-29-20-10-52_1.jpg";

interface stateType {
  userdata: { username: string; usercolor: string; userimage: string };
}

function About() {
  const { state } = useLocation<stateType>();
  console.log(state.userdata);
  return (
    <div>
      <div
        className="center-content-vertically"
        style={{
          zIndex: 1,
          width: "100%",
          backgroundColor: "#00ccff",
          display: "grid",
          position: "absolute",
        }}
      >
        <div
          style={{ backgroundColor: "red", height: "60px", width: "60px" }}
        ></div>
      </div>
      <div
        className="center-content-vertically"
        style={{
          zIndex: 0,
          width: "100%",
          backgroundColor: "#00ccff",
          display: "grid",
          position: "absolute",
        }}
      >
        <img
          style={{
            position: "relative",
            objectFit: "contain",
            width: "30%",
            borderRadius: "200px",
            margin: "auto",
          }}
          src={profilePic}
          alt="SuperstarZ logo"
        />
      </div>
    </div>
  );
}

export default About;
